systemRequirementsSection:
Operating Systems: Windows 8.1, Windows 8, Windows 7 (x86, x64), Windows Server 2012 R2; Linux with GLIBC 2.3 to 2.18 (x86, x64, PowerPC); Mac OS X 10.5 to 10.9 (PowerPC, Intel); Solaris 8, 9, 10 (SPARC, x86, x64); AIX 5.2 to 7.1 (POWER); HP-UX 11i v1 to v3 (PA-RISC, Itanium).

Any of the following versions of the Java runtime: Oracle Java™ 1.5 to 7, or IBM Java™ 1.5 to 7 on Windows; Apple Java™ 1.5 to 7 on Mac OS X; Sun Java™ 1.5 to 7 on Linux or Solaris; IBM Java™ 1.5 to 7 on Linux or AIX; HP Java™ 1.5 to 7 on HP-UX; 

Git-TF is supported for use with the following versions of TFS: Team Foundation Server 2013, 2012, 2010 or Visual Studio Online
